import React, {useEffect} from 'react';
import Nav from "../../components/main/Nav";

const CommunityMain = () => {
    useEffect(() => {
        if (localStorage.getItem("token") == null) {
            window.location.href = "http://localhost:3000/login"
        }
    })

    return (
        <div>
            <Nav />
            <br/>
            <CommunityPostCard />
            <CommunityPostCard />
            <CommunityPostCard />
            <CommunityPostCard />
            <CommunityPostCard />
        </div>
    );
};


export default CommunityMain;
